import time

import requests


class Anticaptcha():
    def __init__(self, url ='http://90.188.15.14:9085', token = 'e9e783d3e52abd6101fc807ab1109400'):
        self.url = url
        self.uin = self.url + '/in.php'
        self.ures = self.url + '/res.php'
        self.token = token
        self.id = None
        self.session = requests.session()
        self.session.headers.update({
            "Content-Type": "application/x-www-form-urlencoded"
        })

    def _init_request(self, b64image:str):
        data = {
            'method':'base64',
            'body': b64image,
            'key': self.token
        }
        r = requests.post(self.uin, data=data)
        if r:
            buf = r.text.split('|')
            status = buf[0]
            self.id = buf[1]
            #print(r.text)
            #print(self.id)
            return self.id
        else:
            self.id = None
            return None

    def _resolve_request(self):
        #print(self.id)
        if self.id:
            data = {
                'action': 'get',
                'id': self.id,
                'key': self.token
            }
            r = requests.post(self.ures, data=data)
            #print(r.status_code)
            if r:
                buf = r.text.split('|')
                status = buf[0]
                result = buf[1]
                #print(r.text)
                if status == 'OK':
                    return result
                else:
                    time.sleep(1)
                    return self._resolve_request()
                    #return None
            else:
                return None

    def resolve_captcha(self, captchaImage:str):
        r = self._init_request(captchaImage)
        #print(r)
        if r:
            r = self._resolve_request()
            if r:
                return r


if __name__ == '__main__':
    a = Anticaptcha()
    a.resolve_captcha('')
